import React from "react";
import "./SobrePantalla.css";
import Logo from "../../assets/img/Logo1.png";
import Header from "../Header/Header";

export default function SobrePantalla() {
  return (
    <div className="SobrePantalla">
      <img
        src={Logo}
        width="200px"
        height="200px"
        className="logo"
        onClick={Header}
      ></img>
    </div>
  );
}
